sourcesContent:
import styled from "styled-components"
export const Wrapper = styled.div`

display: flex;
align-items: flex-center;
justify-content: space-between;
background:#1786b1;
color: #01474f;


@media screen and (max-width: 768px){

    display: block;
    max-height: none;
}


`;
